import React from 'react';
import "./Info.scss";

const Info = () => {
    return (
        <main className='Info'>
            <section className='Info__my-info'>
                <div><span>Front-end Developer</span></div>
                <div><span>Email. </span>gothddlek@naver.com</div>
                <div><span>Birth. </span>2001.06.30</div>
                <div><span>Residence. </span>Gumi, South Korea</div>
                <div><span>Bachelor Degree. </span>Kumoh Institute of Technology. Electronic IT convergence (2020.03 - 2024.02)</div>
            </section>
            <section className='Info__introduce'>
                <div>안녕하세요 :) 주니어 Front-end 개발자 안재현입니다. <br />눈에 보이는 것을 직접 조작할 수 있는 Front-end의 매력에 빠져 Front-end 개발자를 꿈꾸게 되었습니다. <br />수많은 경험과 학습을 통해 다양한 기술 스택을 습득하고 적재적소에 알맞는 기술을 사용하여 <br />최적의 사용자 경험을 전달할 수 있는 Front-end 개발자가 되고싶습니다.</div>
            </section>
        </main>
    );
};

export default Info;
